import React from 'react';

class JsonTable extends React.Component {

    constructor(props) {
        super(props);
    }
    render() {
        return (
            <tbody> this.props.data.map(function(item, key) { 
                <tr key = {key}>
                    <td>{item.userId}</td>
                    <td>{item.id}</td>
                    <td>{item.title}</td>
                    <td>{item.body}</td>
                </tr> })}
            </tbody>
        )
    }
};

export default JsonTable;
